create table t_itm_evl
(
    itm_id     varchar not null
        constraint t_itm_evl_m_itm_itm_id_fk
            references m_itm,
    evl_lst_no integer not null,
    cus_id     varchar not null
        constraint t_itm_evl_m_cus_cus_id_fk
            references m_cus,
    evl_dsc    varchar(1000),
    evl_dt     timestamp,
    evl_pt     numeric(18, 2),
    constraint t_itm_evl_pk
        primary key (itm_id, evl_lst_no)
);

comment on table t_itm_evl is '아이템 평가
고객이 아이템에 평가를 수행한 기록';

comment on column t_itm_evl.itm_id is '아이템ID';

comment on column t_itm_evl.evl_lst_no is '평가순번
';

comment on column t_itm_evl.cus_id is '고객ID(FK)';

comment on column t_itm_evl.evl_dsc is '평가내용';

comment on column t_itm_evl.evl_dt is '평가일시';

comment on column t_itm_evl.evl_pt is '평가점수';

alter table t_itm_evl
    owner to postgres;

create unique index t_itm_evl_itm_id_evl_lst_no_uindex
    on t_itm_evl (itm_id, evl_lst_no);

